${function}(ctx){
    var res = ctx.newResult();
//Запись значений с формы в переменные
  var p_text = Whirl.Helper.findBuilderByCode('text');
  var p_num = Whirl.Helper.findBuilderByCode('num');
  var p_data = Whirl.Helper.findBuilderByCode('date');
  var p_flag = Whirl.Helper.findBuilderByCode('flag');
//Объявление новых переменных для передачи в следующее событие:
    var p1 = new Whirl.EventParameter('DATAVALUE');
    var d1 = new Whirl.DataValue('STRING');
    p1.setCode('g_text'); 
    var p2 = new Whirl.EventParameter('DATAVALUE');
    var d2 = new Whirl.DataValue('STRING');
    p2.setCode('g_num');  
    var p3 = new Whirl.EventParameter('DATAVALUE');
    var d3 = new Whirl.DataValue('STRING');
    p3.setCode('g_date');   
    var p4 = new Whirl.EventParameter('DATAVALUE');
    var d4 = new Whirl.DataValue('BOOLEAN');
    p4.setCode('g_flag');  

    d1.setValue(p_text.getValue());
    d2.setValue(p_num.getText());
    d3.setValue(p_data.getText());
    d4.setValue(p_flag.getValue());

    p1.setData(d1);
    p2.setData(d2);
    p3.setData(d3);
    p4.setData(d4);

    res.addParameter(p1);
    res.addParameter(p2);
    res.addParameter(p3);
    res.addParameter(p4);

    res.setNextEventCode('ora_get_param');
    //alert('ok');
    return res; 
}

