${function}(ctx){
  var check = function() {
    setTimeout(function() {
      var win = Whirl.Helper.findBuilderByCode('js_result');

      if (win == undefined) {
        check();
      } else {
        //Присвоение значений переменных полям на форме
  var text_p = Whirl.Helper.findBuilderByCode('text_js');

  var num_p = Whirl.Helper.findBuilderByCode('num_js');
  var date_p = Whirl.Helper.findBuilderByCode('date_js');
  var flag_p = Whirl.Helper.findBuilderByCode('flag_js');
  //Запись входящих значений в переменную
  var v1 = ctx.getParameterByCode('g_text').getStringValue();

  if (v1 == null || v1.length == 0) {text_p.setHtml('null');}
  else {text_p.setHtml(v1);}

  var v2 = ctx.getParameterByCode('g_num').getStringValue();
       if (v2.length == 0) {num_p.setHtml('null');}
        else {num_p.setHtml(v2);}

  try {var v3 = ctx.getParameterByCode('g_date').getDateValue();
       date_p.setValue(v3);}
  catch(error) {date_p.clear();}

  var v4 = ctx.getParameterByCode('g_flag').getBooleanValue();
      if (v4 == false)
       {flag_p.setHtml('F');}
      else
       {flag_p.setHtml('T');} 
      }
    }, 500);

  };

  check();

}

